import React, { useState, useEffect, useCallback, useRef } from "react";

const UserList = () => {
    const [users, setUsers] = useState([]);
    const resultData = useRef([]);

    const getUsers = useCallback(async () => {
        const result = await fetch('http://localhost:5000/api/users', {
            method: 'get',
            headers: {
                'Content-Type': 'application/json'
            }
        });

        const data = await result.json();
        resultData.current = data;
        setUsers(data);
    }, []);

    useEffect(() => {
        getUsers();
    }, [getUsers]);

    console.warn("users", users);

    return (
        <form className="inline-grid mt-28 rounded-3xl justify-center bg-stone-200">
            <div className="mt-2">
                <h1 className='text-center font-bold text-2xl text-stone-600'>Add Vehicle</h1>
            </div>
            <div>
                <table className='border'>
                    <thead>
                        <tr>
                            <th className='px-4'>User ID</th>
                            <th className='px-4'>User Name</th>
                            <th className='px-4'>Email</th>
                            <th className='px-4'>isAdmin</th>
                            <th className='px-4'>Password</th>
                            <th className='px-4'>Actions</th>
                        </tr>
                    </thead>
                    <tbody className=" text-sm">
                        {resultData.current.map((result) => (
                            <tr key={result._id}>
                                <td className='px-3'>{result._id}</td>
                                <td className='px-3'>{result.name}</td>
                                <td className='px-3'>{result.email}</td>
                                <td className='px-3'>{result.password}</td>
                                <td className='px-3'>{result.isAdmin}</td>
                                <td className='px-2 text-white'>
                                    <button className='mx-2 bg-stone-600 rounded-xl px-3 font-medium hover:bg-stone-700 hover:font-bold'>Edit</button>
                                    <button className='mx-2 bg-red-600 rounded-xl px-3 font-medium hover:bg-red-700'>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </form>
    );
};

export default UserList;
